import React, { useState } from 'react';
import axios from 'axios';
import './AddRestaurant.css';

const AddRestaurant = () => {
  const [restaurantName, setRestaurantName] = useState('');
  const [restaurantAddress, setRestaurantAddress] = useState('');
  const [contactNumber, setContactNumber] = useState('');
  const [description, setDescription] = useState('');
  const [restaurantImage, setRestaurantImage] = useState(null);
  const [isOpen, setIsOpen] = useState(false);
  const [errors, setErrors] = useState({});
  const userId = localStorage.getItem('userId');

  const validateRestaurantName = (name) => {
    const re = /^[A-Za-z\s]+$/;
    return re.test(name);
  };

  const validateContactNumber = (contactNumber) => {
    const re = /^[9876]\d{9}$/;
    return re.test(contactNumber);
  };

  const validateDescription = (description) => {
    return description && description.length <= 255;
  };

  const handleFileChange = (event) => {
    setRestaurantImage(event.target.files[0]);
  };

  const handleSubmit = async (event) => {
    event.preventDefault();

    let validationErrors = {};

    if (!restaurantName) {
      validationErrors.restaurantName = 'Restaurant name is required.';
    } else if (!validateRestaurantName(restaurantName)) {
      validationErrors.restaurantName = 'Restaurant name must contain only alphabets and spaces.';
    }

    if (!restaurantAddress) {
      validationErrors.restaurantAddress = 'Restaurant address is required.';
    }

    if (!contactNumber) {
      validationErrors.contactNumber = 'Contact number is required.';
    } else if (!validateContactNumber(contactNumber)) {
      validationErrors.contactNumber = 'Phone number must start with 9, 8, 7, or 6 and contain 10 digits.';
    }

    if (!description) {
      validationErrors.description = 'Description is required.';
    } else if (!validateDescription(description)) {
      validationErrors.description = 'Description cannot exceed 255 characters.';
    }

    if (Object.keys(validationErrors).length === 0) {
      const formData = new FormData();
      formData.append('userId', userId);
      formData.append('restaurantName', restaurantName);
      formData.append('restaurantAddress', restaurantAddress);
      formData.append('contactNumber', contactNumber);
      formData.append('description', description);
      formData.append('isOpen', isOpen);
      formData.append('restaurantImage', restaurantImage);

      try {
        const response = await axios.post('http://localhost:300/restaurant/addRestaurant', formData);
        console.log('Restaurant added successfully', response.data);
        // Handle success
      } catch (error) {
        console.error('There was an error adding the restaurant!', error);
      }
    } else {
      setErrors(validationErrors);
    }
  };

  return (
    <div className="add-restaurant-container">
      <h2>Add Restaurant</h2>
      <form onSubmit={handleSubmit} encType="multipart/form-data">
        <div className="form-group">
          <label htmlFor="restaurantName">Restaurant Name:</label>
          <input
            type="text"
            id="restaurantName"
            value={restaurantName}
            onChange={(e) => setRestaurantName(e.target.value)}
            required
          />
          {errors.restaurantName && <p className="error">{errors.restaurantName}</p>}
        </div>

        <div className="form-group">
          <label htmlFor="restaurantAddress">Restaurant Address:</label>
          <input
            type="text"
            id="restaurantAddress"
            value={restaurantAddress}
            onChange={(e) => setRestaurantAddress(e.target.value)}
            required
          />
          {errors.restaurantAddress && <p className="error">{errors.restaurantAddress}</p>}
        </div>

        <div className="form-group">
          <label htmlFor="contactNumber">Contact Number:</label>
          <input
            type="text"
            id="contactNumber"
            value={contactNumber}
            onChange={(e) => setContactNumber(e.target.value)}
            pattern="^[9876]\d{9}$"
            title="Phone number must start with 9, 8, 7, or 6 and contain 10 digits"
            required
          />
          {errors.contactNumber && <p className="error">{errors.contactNumber}</p>}
        </div>

        <div className="form-group">
          <label htmlFor="description">Description:</label>
          <textarea
            id="description"
            value={description}
            onChange={(e) => setDescription(e.target.value)}
            required
          ></textarea>
          {errors.description && <p className="error">{errors.description}</p>}
        </div>

        <div className="form-group">
          <label htmlFor="isOpen">Is Open:</label>
          <input
            type="checkbox"
            id="isOpen"
            checked={isOpen}
            onChange={(e) => setIsOpen(e.target.checked)}
          />
        </div>

        <div className="form-group">
          <label htmlFor="restaurantImage">Restaurant Image:</label>
          <input
            type="file"
            id="restaurantImage"
            accept="image/*"
            onChange={handleFileChange}
            required
          />
        </div>

        <button type="submit">Add Restaurant</button>
      </form>
    </div>
  );
};

export default AddRestaurant;
